import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Items from "./components/Items"

class App extends React.Component() {
    constructor(props) {
      super(props)
      this.state = {
        items: [
          {
            id: 1,
            title: 'Gray tent',
            img: 'graytent.jpg',
            desc: 'Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum.',
            category: 'tents',
            price: '89.99$'
          },
          {
            id: 2,
            title: 'Green tent',
            img: 'greentent.jpg',
            desc: 'Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum.',
            category: 'tents',
            price: '89.99$'
          },
          {
            id: 3,
            title: 'Black tent',
            img: 'blacktent.jpg',
            desc: 'Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum.',
            category: 'tents',
            price: '89.99$'
          }
        ]
      }
    }

    render() {
        return (
            <div className="wrapper">
                <Header />
                <Items items={this.state.items}/>
                <Footer />
            </div>
        );
    }
}

export default App;
